import React from 'react'

const Cards = () => {
  return (
    <div className='flex flex-wrap justify-between p-3 mt-2'>
        <div>
         <img className='h-40' src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT8Q9JG-WptxaThfsQ-gJtetMMKCctHCn4862wLDE5NPa0W_-m7VbGiDAEFJZiRFs-LAA0&usqp=CAU'/>
        </div>
    </div>
  )
}

export default Cards;
